

public class Main {
    public static String transcribe(String dna) {
        return dna.replace("T", "U");
    }

    public static void main(String[] args) {
        String dna = "";
        String rna = transcribe(dna);
        System.out.println(rna); // prints "GAUGGAACUUGACUACGUAAAUU"
    }
}
